import React from "react";
import { TaskInterface } from "../../data/Tasks";
import "./TodoItem.css";

function TodoItem(props: TaskInterface) {
  return (
    <div className="TodoItem">
      <div>
        <input type="checkbox" checked={props.id.status}></input>
        <label>{props.id.task}</label>
      </div>

      <div className="icons">
        <h4>delete|</h4>
        <h4>edit</h4>
      </div>
    </div>
  );
}

export default TodoItem;
